function internal:get_zone_quests(zone)
    if type(zone) == "string" and internal.quest_locations[zone] ~= nil then
        return ZO_DeepTableCopy(internal.quest_locations[zone])
    else
        return {}
    end
end

function internal:get_quests_zonename(zone)
    if type(zone) == "string" and internal.quest_locations[zone] ~= nil then
        return ZO_DeepTableCopy(internal.quest_locations[zone])
    else
        return {}
    end
end

function internal:get_all_zones()
    local locations = ZO_DeepTableCopy(internal.quest_locations)
    return locations
end
